pub unsafe fn vld4_f16(a: *const f16) -> float16x4x4_t {
    unsafe extern "unadjusted" {
        #[cfg_attr(
            any(target_arch = "aarch64", target_arch = "arm64ec"),
            link_name = "llvm.aarch64.neon.ld4.v4f16.p0"
        )]
        fn _vld4_f16(ptr: *const f16) -> float16x4x4_t;
    }
    _vld4_f16(a as _)
}
